(function averagePassingScore(scores){var pass = 70;
var total = 0;
var count = 0;
if(scores.length==0){
  return 0;
}
for (var i = 0; i < scores.length; i++) {
  if (scores[i] >= pass) {
    total += scores[i];
    count++;
  }
}
return total/count;
})

